mixin.column:
{chaH:n} / {bIH:n}: {ghaH:n} / {'oH:n} = {lu-:v:pref,nolink}

Kun sitä käytetään {-lu':v}: n kanssa, tämä etuliite tarkoittaa "Joku (määrittelemätön aihe) tekee heille jotain".

Tämä etuliite pudotetaan joskus tuntemattomista syistä. Vaikka virhe onkin, tämä jätetään usein huomiotta, kun selkeys ei ole ongelma, paitsi muodollisissa tilanteissa.[2] [AUTOTRANSLATED]
